import MySidebar from './components/sidebar/sidebar';
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path='/' Component={MySidebar}/>
          render={() => (
        <>
          <Component1 />
          <Component2 />
        </>
      )}        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
